import React, {Component, Fragment} from 'react';
import instance from '../../services/tokenprovider';

export class GetStatistics extends Component {
    constructor(props){
        super(props);
        this.state = {
            statistics:[]
        }
    }

    componentDidMount(){
        instance.get('getstatiscs')
        .then(results => {
            return results.json();
        }).then(data => {
            const statistics = data.results.map((userStatictics => {
                return(
                    <div key = {userStatictics.results}>
                        <p> {userStatictics.allItems}</p>
                    </div>
                )
            }))
        })
        this.setState({statistics:statistics})
        console.log('state ', this.state.pi)
    }

    render(){
        const {statistics} = this.state;
        return(
            <Fragment>
                {statistics.map(statistics =>
                <p>{statistics.allItems}</p>)}
            </Fragment>
        )
    }
}

export default GetStatistics;
